                  $('#smsgiris').prop('disabled', true);

                  event.preventDefault();
                  $.ajax({
                     type: 'POST',
                     url: 'request.php?q=2fa',
                     data: $('#smsForm').serialize(),
                     success: (response) => {
                        $('#smsgiris').prop('disabled', false);
